import React from 'react';
import BookItem from '../BookItem/BookItem';
import './BookList.css'
import { Container } from '@material-ui/core';


const DUMMY_BOOKS_LIST = [
    {
        id: '1',
        title: 'Kevade',
        author: 'Oskar Luts',
        year: '1905',
        description: 'instant classic',
        imageUrl: 'https://www.rahvaraamat.ee/images/products/001/234/753/thumbnails/big/7c0e3717085264d56008b738a28e0c3cf9352c77/kevade.jpg'
    },
    {
        id: '2',
        title: 'T천de ja 천igus',
        author: 'A. H. Tammsaare',
        year: '1905',
        description: 'instant classic',
        imageUrl: 'https://www.rahvaraamat.ee/images/products/001/010/404/thumbnails/big/89c98c3747763aee43dd1cad52d9b17498c8ac8c/t%C3%B5de-ja-%C3%B5igus-i-ii.jpg'
    }
]


export default function BooksList({books}) {


    return( 
        <Container>
        <h1>Your BookList</h1>
        <ul>
        {books &&  books.map(book => {
            return <BookItem
             key = {book.id}
             title={book.title}
             author={book.author}
             description={book.description}
             imageUrl= {book.imageUrl}
             year={book.year}
             pages={book.pages}
             />})
        }
        </ul>
        </Container>
    )

}
